import styled from 'styled-components';

export const ModulesIcons = styled.div`
display:flex;
justify-content:space-around;
`;

export const Module = styled.div`
display:flex;
flex-direction: column;
align-items: center;
`;

export const Moduleh1 = styled.h1`
width: 100px;
font-size: 12px;
font-weight: 1000;
color: #000;
`;
